  acr : SET OF Assembly_component_relationship := input.occurrence_contexts;
  pvd : SET OF Product_view_definition := [];
END_LOCAL;
REPEAT i := 1 TO HIINDEX(acr) BY 1;
  pvd := pvd + acr[i]\View_definition_relationship.relating_view; 
END_REPEAT;

RETURN (pvd);

